import React, { useEffect, useRef } from "react";

const CanvasComponent = () => {
  const canvasRef = useRef(null);
  let rafID;
  let context;
  let pointsA;
  let pointsB;
  let mouseX = 0;
  let mouseY = 0;
  let relMouseX = 0;
  let relMouseY = 0;
  let mouseDirectionX = 0;
  let mouseDirectionY = 0;
  let mouseSpeedX = 0;
  let mouseSpeedY = 0;
  let mouseDist = 0;
  const viscosity = 15;
  const damping = 0.05;
  const showIndicators = true;

  const Point = (x, y) => {
    this.x = this.ix = 50 + x;
    this.y = this.iy = 50 + y;
    this.vx = 0;
    this.vy = 0;
    this.cx1 = 0;
    this.cy1 = 0;
    this.cx2 = 0;
    this.cy2 = 0;
    this.level = 0;
  };

  Point.prototype.move = function () {
    this.vx += (this.ix - this.x) / (viscosity * this.level);
    this.vy += (this.iy - this.y) / (viscosity * this.level);

    const dx = this.ix - relMouseX;
    const dy = this.iy - relMouseY;
    const relDist = (1 - Math.sqrt(dx * dx + dy * dy)) / mouseDist;

    // Move x
    if (
      (mouseDirectionX > 0 && relMouseX > this.x) ||
      (mouseDirectionX < 0 && relMouseX < this.x)
    ) {
      if (relDist > 0 && relDist < 1) {
        this.vx = (mouseSpeedX / 4) * relDist;
      }
    }
    this.vx *= 1 - damping;
    this.x += this.vx;

    // Move y
    if (
      (mouseDirectionY > 0 && relMouseY > this.y) ||
      (mouseDirectionY < 0 && relMouseY < this.y)
    ) {
      if (relDist > 0 && relDist < 1) {
        this.vy = (mouseSpeedY / 4) * relDist;
      }
    }
    this.vy *= 1 - damping;
    this.y += this.vy;
  };

  const renderCanvas = () => {
    rafID = requestAnimationFrame(renderCanvas);

    context.clearRect(0, 0, context.canvas.width, context.canvas.height);
    context.fillStyle = "#fff";
    context.fillRect(0, 0, context.canvas.width, context.canvas.height);

    for (let i = 0; i <= pointsA.length - 1; i++) {
      pointsA[i].move();
      pointsB[i].move();
    }

    const gradientX = Math.min(
      Math.max(mouseX - context.canvas.offsetLeft, 0),
      context.canvas.width
    );
    const gradientY = Math.min(
      Math.max(mouseY - context.canvas.offsetTop, 0),
      context.canvas.height
    );
    const distance =
      Math.sqrt(
        Math.pow(gradientX - context.canvas.width / 2, 2) +
          Math.pow(gradientY - context.canvas.height / 2, 2)
      ) /
      Math.sqrt(
        Math.pow(context.canvas.width / 2, 2) +
          Math.pow(context.canvas.height / 2, 2)
      );

    context.lineWidth = 0.5 + 30 * distance;
    context.strokeStyle = "rgba(0,0,0,0.02)";
    context.fillStyle = "rgba(0,0,0,0.05)";
    context.beginPath();

    for (let i = 0; i <= pointsA.length - 1; i++) {
      const pointA = pointsA[i];
      const pointB = pointsB[i];

      if (i === 0) {
        context.moveTo(pointA.x, pointA.y);
      }

      const nextA = pointsA[i + 1] || pointsA[0];
      const nextB = pointsB[i + 1] || pointsB[0];

      const cAx = (pointA.x + nextA.x) / 2;
      const cAy = (pointA.y + nextA.y) / 2;
      const cBx = (pointB.x + nextB.x) / 2;
      const cBy = (pointB.y + nextB.y) / 2;

      context.quadraticCurveTo(pointA.x, pointA.y, cAx, cAy);
      context.quadraticCurveTo(pointB.x, pointB.y, cBx, cBy);
    }

    context.closePath();
    context.fill();
    context.stroke();

    if (showIndicators) {
      // Draw points
      context.fillStyle = "#000";
      context.beginPath();
      for (let i = 0; i <= pointsA.length - 1; i++) {
        const p = pointsA[i];
        context.rect(p.x - 1, p.y - 1, 2, 2);
      }
      context.fill();

      // Draw controls
      context.fillStyle = "#f00";
      context.beginPath();
      for (let i = 0; i <= pointsA.length - 1; i++) {
        const p = pointsA[i];
        context.rect(p.cx1 - 1, p.cy1 - 1, 2, 2);
        context.rect(p.cx2 - 1, p.cy2 - 1, 2, 2);
      }
      context.fill();
    }
  };

  const handleMouseMove = (event) => {
    mouseX = event.clientX - canvasRef.current.offsetLeft;
    mouseY = event.clientY - canvasRef.current.offsetTop;
    mouseDirectionX = mouseX - relMouseX < 0 ? -1 : 1;
    mouseDirectionY = mouseY - relMouseY < 0 ? -1 : 1;
    mouseSpeedX = Math.abs(mouseX - relMouseX);
    mouseSpeedY = Math.abs(mouseY - relMouseY);
    relMouseX = mouseX - canvasRef.current.offsetLeft;
    relMouseY = mouseY - canvasRef.current.offsetTop;
    mouseDist = Math.sqrt(
      Math.pow(relMouseX - context.canvas.width / 2, 2) +
        Math.pow(relMouseY - context.canvas.height / 2, 2)
    );
  };

  useEffect(() => {
    context = canvasRef.current.getContext("2d");
    context.canvas.width = window.innerWidth;
    context.canvas.height = window.innerHeight;

    pointsA = [];
    pointsB = [];

    for (let i = 0; i <= 10; i++) {
      pointsA.push(new Point(i * (context.canvas.width / 10), 0));
      pointsB.push(
        new Point(i * (context.canvas.width / 10), context.canvas.height)
      );
    }

    document.addEventListener("mousemove", handleMouseMove);
    renderCanvas();

    return () => {
      cancelAnimationFrame(rafID);
      document.removeEventListener("mousemove", handleMouseMove);
    };
  }, []);

  return <canvas ref={canvasRef} />;
};

export default CanvasComponent;
